import { styled } from "styled-components";
import ProfileHeader from "../component/user/ProfileHeader"
import SideBar from "../component/SideBar";
import ProfileCartegory from "../component/user/ProfileCategory"

const ProfilePageContainer = styled.div`
  display: flex;
`
const ProfileContainer = styled.div`
  width: 100%;
  margin: 30px;
  border: 1px solid;
`


const StatsContainer = styled.section`
  width: 600px;
  margin-left: 20px;
  > h2 {
  }
  > .StatsBox{
    border: 2px solid var(--silver);
    border-radius: 20px;
    height: 200px;
    width: 100%;
    display: flex;
    flex-direction: column;
    > .column {
      display: flex;
      flex-grow: 1;
      > .stat {
        margin: 0 30px;
        margin-right: 180px;
        & > :first-child {
          font-size: 130%;
          color: var(--black);
        }
        & > :last-child {
          color: var(--silver-darker);
        }
      }
  }
  }
`

const ActivityContainer = styled.section`
  height: 800px;
  width: 100%;
  border: 1pc solid ;
`

function Profile() {
  return (
    <ProfilePageContainer>
      <SideBar/>
      <ProfileContainer>
        <ProfileHeader/>
        <ProfileCartegory text={`Profile`}/>

        <StatsContainer>
          <h2>Stats</h2>
          <div className="StatsBox">
            <div className="column">
              <div className="stat">
                <p>a</p>
                <p>questions</p>
              </div>
              <div className="stat">
                <p>a</p>
                <p>answers</p>
              </div>
            </div>
            <div className="column">
              <div className="stat">
                <p>a</p>
                <p>createdAt</p>
              </div>
              <div className="stat">
                <p>a</p>
                <p>email</p>
              </div>
            </div>
          </div>
        </StatsContainer>
        <ProfileCartegory text={`Activity`}/>

      </ProfileContainer>
    </ProfilePageContainer>
  );
}

export default Profile;
